import React from 'react';
import Auth from './components/Auth'
import { Provider } from 'react-redux'
import store from './appRedux/store'

function App() {
  return (
    <div className="App">
      <Provider store={store()}>
        <Auth />
      </Provider>
    </div>
  );
}

export default App;
